import { IonContent, IonHeader, IonPage,IonButton, IonTitle, IonToolbar, IonTabs, IonTabBar, IonTabButton, IonIcon, IonLabel, IonItem, IonInput, IonBadge, IonRouterOutlet, IonRow, IonCol  } from '@ionic/react';
import React, { useState } from 'react';
import { book, search, person,personCircle } from 'ionicons/icons';
import ExploreContainer from '../components/ExploreContainer';
import './Home.css';



const Login: React.FC = () => {

  const [text, setText] = useState<string>();
  const [number, setNumber] = useState<number>();
  const [email, setEmail] = useState<string>();
  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>Login</IonTitle>
        </IonToolbar>
      </IonHeader>
      <IonRow>
        <IonCol>
          <IonIcon
            style={{ fontSize: "70px", color: "#0040ff" }}
            icon={personCircle}
          />
          </IonCol>
      </IonRow>
      <IonRow>
        <IonCol>
          <IonItem>
            <IonLabel position="floating"> Email</IonLabel>
              <IonInput
                type="email"
                value={email}
                onIonChange={(e) => setEmail(e.detail.value!)}
              >
              </IonInput>
          </IonItem>
        </IonCol>
      </IonRow>
      <IonRow>
      <IonCol>
        <p style={{ fontSize: "small" }}>
        By clicking LOGIN you agree to our <a href="#">Policy</a>
        </p>
          <IonButton expand="block">
            Login
          </IonButton>
        <p style={{ fontSize: "medium" }}>
        Don't have an account? <a href="#">Sign up!</a>
        </p>
        </IonCol>
      </IonRow>
    </IonPage>
  );
};

export default Login;
